import './styles.scss';
import React, {useState, useRef, useEffect} from 'react';
import {
  Section,
  Title as SectionTitle,
  Body as SectionBody,
  Header as SectionHeader
} from "../../../common/ui/Section";
import {connect} from 'react-redux'
import {useTranslation} from "react-i18next";
import {Button} from "../../../common/ui/Button";
import _ from "lodash";
import {setValue} from "../../../../store/survey/actions";

const IMG_FRONT = 'data:image/png;base64,';
const IMG_SIDE = 'data:image/png;base64,';
const IMG_BACK = 'data:image/png;base64,';

const toBase64 = file => new Promise((resolve, reject) => {
  const reader = new FileReader();
  reader.readAsDataURL(file);
  reader.onload = () => resolve(reader.result);
  reader.onerror = error => reject(error);
});

const UploadImageCard = ({image, fallbackImage, label, onChange = () => null}) => {
  const id = `${Math.random()}`;
  const input = useRef();
  const {t} = useTranslation('main');

  const [src, setSrc] = useState(image);

  const handleAddClick = () => {
    if(!input.current) return;
    input.current.click();
  };

  const handleImage = (e) => {
    onChange(e.target.files[0]);
  };

  useEffect(() => {
    if(image instanceof File) {
      toBase64(image).then(setSrc)
    } else if (image instanceof String) {
      setSrc(image)
    }
  }, [image]);

  return (
    <div className={'upload-image-card'}>
      <div className={`preview ${!src ? 'empty' : ''}`} style={{backgroundImage: `url(${src || fallbackImage})`}} />
      <div className={'controls'}>
        <input
          ref={input}
          accept="image/*"
          className={'hidden'}
          id={id}
          type="file"
          onChange={handleImage}
        />
        <label htmlFor={id}>
          <Button variant={'default'} inverse onClick={handleAddClick}>
            {t('bodyPictures.actions.addPhoto')}
          </Button>
        </label>
        <span>{label}</span>
      </div>
    </div>
  );
};

const BodyPictures = (props) => {
  const {t} = useTranslation('main');

  const {
    photo = {},
    setPhoto = () => null
  } = props;

  const { front, side, back } = photo;

  const handleImage = (name, file) => {
    setPhoto({
      ...photo,
      [name]: file
    })
  };

  return (
    <Section id={'body-pictures'}>
      <SectionHeader>
        <SectionTitle>
          {t('bodyPictures.title')}
        </SectionTitle>
      </SectionHeader>
      <SectionBody>
        <p className={'description'} dangerouslySetInnerHTML={{__html: t('bodyPictures.description')}} />
        <div className={'cards-wrapper'}>
          <UploadImageCard
            image={front}
            label={t('bodyPictures.options.front')}
            fallbackImage={IMG_FRONT}
            onChange={(file) => handleImage('front', file)}
          />
          <UploadImageCard
            image={side}
            label={t('bodyPictures.options.side')}
            fallbackImage={IMG_SIDE}
            onChange={(file) => handleImage('side', file)}
          />
          <UploadImageCard
            image={back}
            label={t('bodyPictures.options.back')}
            fallbackImage={IMG_BACK}
            onChange={(file) => handleImage('back', file)}
          />
        </div>
      </SectionBody>
    </Section>
  );
};

const mapStateToProps = (state) => ({
  photo: _.get(state.survey.data, 'photo', {}),
});

const mapDispatchToProps = dispatch => ({
  setPhoto: (value) => dispatch(setValue('photo', value)),
});


export default connect(mapStateToProps, mapDispatchToProps)(BodyPictures);